import React from 'react';
import './App.css';
import Auth from './component/Auth';
//import loginpage from './component/login';
import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";


function App() {
  return (
    <div className="App">

      <Router>
        <Link to="/"> </Link>
        <Link to="home"> </Link>
        <Link to="/"> </Link> 

        <Switch>
          <Route path="/">
            <Auth />
          </Route>
        </Switch>
      </Router>





    </div>
  );
}

export default App;
